import React, { Component } from "react";

class Features extends Component {
  state = {
    count: 0,
    yearBuilt: 1969,
    taxAmount: 4542.86,
    noOfBathrooms: 2,
    noOfBedrooms: 3,
    area: 1476,
  };

  render() {
    return (
      <React.Fragment className="bg-primary">
        {this.renderHeader()}
        {this.renderInputs()}
        <h2
          style={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
          }}
        >
          Graph to be implemented
        </h2>
      </React.Fragment>
    );
  }

  renderHeader() {
    return (
      <div
        style={{
          fontSize: 40,
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
        }}
        className="bg-primary text-white"
      >
        House Price Predictor
      </div>
    );
  }

  renderInputs() {
    const margin = "m-5";

    return (
      <React.Fragment>
        <input
          type="text"
          placeholder="Tax Amount"
          name="tax"
          className={margin}
        />
        <input
          type="text"
          placeholder="Number of Bathrooms"
          name="bathrooms"
          className={margin}
        />
        <input
          type="text"
          placeholder="Number of Bedrooms"
          name="bedrooms"
          className={margin}
        />
        <input
          type="text"
          placeholder="Year Built"
          name="year"
          className={margin}
        />
        <input type="text" placeholder="Area" name="area" className={margin} />
      </React.Fragment>
    );
  }
}

export default Features;
